Calvin Harris (born Adam Richard Wiles on 17 January 1984 in Dumfries, Scotland)is a Scottish electronic musician, singer-songwriter and record producer. His gold-selling debut album, I Created Disco, was released in 2007 and contained the Top 10 singles &quot;Acceptable in the 80s&quot; and &quot;The Girls&quot;. He has written and produced records for other recording artists including Kylie Minogue's X and his number 1 collaboration with British rapper Dizzee Rascal, &quot;Dance Wiv Me&quot;.

His second studio album Ready for the Weekend was released on 17 August 2009 and reached number 1 in the UK Album Charts on 23rd August. It contains the number 1 single &quot;I'm Not Alone&quot; the UK Top 5 Single &quot;Ready for the Weekend&quot;, which was released on 10 August and the track &quot;Flashback&quot; which was released as the third single from the album on November 2, 2009.


